import React from 'react'
import './Menu.scss';
import { Link } from "react-router-dom";


export const Menu = props => {
  return (
    <ul>
      <li><a class="active" href="#home">Home</a></li>
      <li><a href="#news">News</a></li>
      <li><a href="#contact">Contact</a></li>
      <li><a href="#about">About</a></li>
    </ul>
  );
}

export default Menu
